oxy_webhelp_navlinks = {"cces_recoverability-d23139e41957":{"topics":[{"title":"Recovering Rubrik Cloud Cluster Elastic Storage for AWS","shortdesc":"<p class=\"shortdesc\">Recover a Rubrik Cloud Cluster Elastic Storage running on AWS. You can do this only         when the cluster nodes cannot be recovered and the cluster has immutability enabled. You         cannot recover any Live Mounts that were running on the cluster.<\/p>","href":"saas\/recovering_rubrik_cc_es_aws.html","attributes":{"data-id":"recovering_rubrik_cc_es_aws"},"menu":{"hasChildren":false},"tocID":"recovering_rubrik_cc_es_aws-d23139e41968","topics":[]},{"title":"Recovering Rubrik Cloud Cluster Elastic Storage for Azure","shortdesc":"<p class=\"shortdesc\">Recover a Rubrik Cloud Cluster Elastic Storage to restore data even when you cannot         retrieve the nodes. You cannot recover Live Mounts.<\/p>","href":"saas\/recovering_rubrik_cc_es_azure.html","attributes":{"data-id":"recovering_rubrik_cc_es_azure"},"menu":{"hasChildren":false},"tocID":"recovering_rubrik_cc_es_azure-d23139e41979","topics":[]}]}};